Pragma foreign_keys=false;
Begin Transaction;
Drop Table If Exists [geoinfo];
CREATE TABLE IF NOT EXISTS  "geoinfo" ("geoinfo_id" INTEGER NOT NULL,
"longtitude1" REAL NOT NULL,
"longtitude2" REAL NOT NULL,
"longtitude3" REAL NOT NULL,
"longtitude4" REAL NOT NULL,
"latitude1" REAL NOT NULL,
"latitude2" REAL NOT NULL,
"latitude3" REAL NOT NULL,
"latitude4" REAL NOT NULL,
"availabe" NUMERIC(3) NOT NULL,
CONSTRAINT "geoinfo_PK_college" PRIMARY KEY("geoinfo_id"));


Drop Table If Exists [usertype];
CREATE TABLE IF NOT EXISTS  "usertype" ("usertype_id" INTEGER NOT NULL,
"usertype_name" INTEGER NOT NULL,
CONSTRAINT "usertype_PK_user" PRIMARY KEY("usertype_id"));


Drop Table If Exists [college];
CREATE TABLE IF NOT EXISTS  "college"(
[college_id] INTEGER NOT NULL
,[college_name] VARCHAR(30) NOT NULL
,[description] TEXT NOT NULL
,[scenicspot_id] INTEGER NOT NULL REFERENCES [scenicspot] ([scenicspot_id]) On Delete CASCADE On Update CASCADE
, Primary Key(college_id)   
);


Drop Table If Exists [major];
CREATE TABLE IF NOT EXISTS  "major"(
[major_id] INTEGER NOT NULL
,[major_name] VARCHAR(30) NOT NULL
,[description] TEXT NOT NULL
,[image] BLOB
,[college_id] INTEGER NOT NULL REFERENCES [college] ([college_id]) On Delete CASCADE On Update CASCADE
, Primary Key(major_id)   
);


Drop Table If Exists [grade];
CREATE TABLE IF NOT EXISTS  "grade"(
[grade_id] INTEGER NOT NULL
,[grade_name] VARCHAR(30) NOT NULL
,[description] TEXT NOT NULL
,[image] BLOB
,[college_id] INTEGER NOT NULL REFERENCES [college] ([college_id]) On Delete CASCADE On Update CASCADE
,[major_id] INTEGER NOT NULL REFERENCES [major] ([major_id]) On Delete CASCADE On Update CASCADE
, Primary Key(grade_id)   
);


Drop Table If Exists [chatroom];
CREATE TABLE IF NOT EXISTS  "chatroom"(
[chatroom_id] INTEGER NOT NULL
,[chatroom_name] VARCHAR(30) NOT NULL
,[parentroom_id] INTEGER NOT NULL
,[image] BLOB
,[college_id] INTEGER NOT NULL REFERENCES [college] ([college_id]) On Delete CASCADE On Update CASCADE
,[major_id] INTEGER NOT NULL REFERENCES [major] ([major_id]) On Delete CASCADE On Update CASCADE
,[grade_id] INTEGER NOT NULL REFERENCES [grade] ([grade_id]) On Delete CASCADE On Update CASCADE
,[level] INTEGER NOT NULL
, Primary Key(chatroom_id)   
);


Drop Table If Exists [scenicspot];
CREATE TABLE IF NOT EXISTS  "scenicspot"(
[scenicspot_id] INTEGER NOT NULL
,[spotname] VARCHAR(45) NOT NULL
,[description] TEXT NOT NULL
,[rate_mean] REAL DEFAULT 0
,[rate_num] INTEGER DEFAULT 0
,[image] BLOB
,[geoinfo_id] INTEGER REFERENCES [geoinfo] ([geoinfo_id]) On Delete CASCADE On Update CASCADE
, Primary Key(scenicspot_id)   
);


Drop Table If Exists [user];
CREATE TABLE IF NOT EXISTS  "user"(
[user_id] INTEGER NOT NULL
,[username] VARCHAR(20) NOT NULL
,[password] VARCHAR(20) NOT NULL
,[sex] VARCHAR(4) NOT NULL
,[email] VARCHAR(30) NOT NULL
,[phone] VARCHAR(20)
,[college_id] INTEGER REFERENCES [college] ([college_id]) On Delete SET NULL On Update SET NULL
,[major_id] INTEGER REFERENCES [major] ([major_id]) On Delete SET NULL On Update SET NULL
,[usertype_id] INTEGER NOT NULL REFERENCES [usertype] ([usertype_id]) On Delete CASCADE On Update CASCADE
,[entrance_year] INTEGER NOT NULL
,[birthday] DATETIME
,[description] TEXT
,[image] BLOB
,[geoinfo_id] INTEGER REFERENCES [geoinfo] ([geoinfo_id]) On Delete SET NULL On Update SET NULL
, Primary Key(user_id)   
);
Drop Table If Exists [message];
CREATE TABLE IF NOT EXISTS  "message"(
[message_id] INTEGER NOT NULL
,[content] TEXT NOT NULL
,[pubdate] DATETIME NOT NULL
,[user_id] INTEGER NOT NULL REFERENCES [user] ([user_id]) On Delete CASCADE On Update CASCADE
,[touser_id] INTEGER NOT NULL REFERENCES [user] ([user_id]) On Delete CASCADE On Update CASCADE
,[tochatroom_id] INTEGER NOT NULL REFERENCES [chatroom] ([chatroom_id]) On Delete CASCADE On Update CASCADE
,[totype] INTEGER NOT NULL
, Primary Key(message_id)   
);


Drop Table If Exists [relation];
CREATE TABLE IF NOT EXISTS  "relation"(
[relation_id] INTEGER NOT NULL
,[user_id1] INTEGER NOT NULL REFERENCES [user] ([user_id]) On Delete CASCADE On Update CASCADE
,[user_id2] INTEGER NOT NULL REFERENCES [user] ([user_id]) On Delete CASCADE On Update CASCADE
, Primary Key(relation_id)   
);


Drop Index  If Exists [chatroom_college_id];
CREATE INDEX IF NOT EXISTS  "chatroom_college_id" ON "chatroom" ("college_id");
Drop Index  If Exists [college_scenicspot_id];
CREATE INDEX IF NOT EXISTS  "college_scenicspot_id" ON "college" ("scenicspot_id");
Drop Index  If Exists [grade_college_id];
CREATE INDEX IF NOT EXISTS  "grade_college_id" ON "grade" ("college_id");
Drop Index  If Exists [major_college_id];
CREATE INDEX IF NOT EXISTS  "major_college_id" ON "major" ("college_id");
Drop Index  If Exists [message_user_id];
CREATE INDEX IF NOT EXISTS  "message_user_id" ON "message" ("user_id");
Drop Index  If Exists [relation_user_id1];
CREATE INDEX IF NOT EXISTS  "relation_user_id1" ON "relation" ("user_id1");
Drop Index  If Exists [scenicspot_geoinfo_id];
CREATE INDEX IF NOT EXISTS  "scenicspot_geoinfo_id" ON "scenicspot" ("geoinfo_id");
Drop Index  If Exists [user_college_id];
CREATE INDEX IF NOT EXISTS  "user_college_id" ON "user" ("college_id");



Commit Transaction;
Pragma foreign_keys=true;
